		public bool isSaveWmsData { get; set; }
		public WebApiConnect conn = new WebApiConnect();
		public List<KeyValuePair<string, string>> httpHeaderList = new List<KeyValuePair<string, string>>();
		public LmsBaseService()
		{
			var commonService = new CommonService();
			var outputJsonInLog = commonService.GetSysGlobalValue("OutputJsonInLog");
			isSaveWmsData = string.IsNullOrWhiteSpace(outputJsonInLog) ? false : outputJsonInLog == "1";

			conn = new WebApiConnect();
			conn.IsUseOAuth2 = false;
			conn.IsDisabledSSLValidate = false;
#if (Ph || Ph_A7)
			conn.IsUseSSL = true;
#endif

			httpHeaderList.Add(new KeyValuePair<string, string>("Authorization", LmsSetting.ApiAuthToken));
		}

		public ApiResult LmsApiFunc<T>(T req, string url)
		{
			var result = conn.PostAsync<T, ApiResult>(string.Format("{0}{1}", LmsSetting.ApiUrl, url), req, httpHeaderList).GetAwaiter().GetResult();
			if (result == null)
				result = new ApiResult { IsSuccessed=false,MsgCode ="99999",MsgContent="回傳無資料" };

			if (conn.IsConnectSuccess == false)
      {
				result.IsSuccessed = false;
				if (conn.IsTimeout)
				{
					result.MsgCode = "99998";
					result.MsgContent = "LMS連線逾時。";
				}
				else
				{
					result.MsgCode = "99999";
					result.MsgContent = "LMS連線異常。";
				}
      }

			result.OriAPIReturnMessage = conn.OriReturnValue;
			result.HttpCode = conn.HttpCode;
			result.HttpContent = conn.HttpContentValue;
      return result;
   }

		public ApiResult LmsApiFuncTest<T>(T req, string url)
		{
			var res = new ApiResult { IsSuccessed = true };
			//var res = new ApiResult { IsSuccessed = false,MsgContent="取得託運單失敗" };
			switch (url)
			{
				case "ShipOrder/Insert": // 申請宅配單號、取消宅配單
					var rd = new Random();
					var t = req as ShipOrderInsertReq;
					if (t.Packages.ProcFlag == "D")
					{
						var d = rd.Next(10);
						if (d == 1)
						{
							res.IsSuccessed = false;
							res.MsgCode = "99999";
							res.MsgContent = "LMS連線異常";
						}
						else if (d == 2)
						{
							res.IsSuccessed = false;
							res.MsgCode = "400-001";
							res.MsgContent = "取消宅單失敗";
						}
					}
					else
					{
						var d = rd.Next(10);
						if (d == 1)
						{
							res.IsSuccessed = false;
							res.MsgCode = "99999";
							res.MsgContent = "LMS連線異常";
						}
						else if (d == 2)
						{
							res.IsSuccessed = false;
							res.MsgCode = "400-001";
							res.MsgContent = "申請宅單失敗";
						}
						else
						{
							res.IsSuccessed = true;
							res.MsgCode = "200";
							res.MsgContent = "申請宅單申請成功";
							res.Data = new LmsDataResult
							{
								DcCode = t.DcCode,
								CustCode = t.CustCode,
								CustOrdNo = t.Packages.CustOrdNo,
								TransportCode = string.Format("{0}{1}", "TP", DateTime.Now.ToString("yyyyMMddHHmmss")+t.Packages.BoxNo),
								TransportProvider = "CAT"
							};
						}
					}
					break;
				case "InboundOrder/Reply": // 訂單出貨結果回傳
					break;
				case "OutboundOrder/Reply": // 商品進倉結果回傳
					break;
				case "VendorReturnOrder/Reply": //廠退出貨結果回傳
					break;
				case "VendorReturnOrder/ShipOrder/Insert":  // 廠退出貨印單申請
					var rt = req as VnrReturnReq;
					var data = new List<LmsVendorReturnOrderData>
										{
											new LmsVendorReturnOrderData
											{
												WmsOrdNo = rt.Orders[0].WmsOrdNo,
											}
										};
					if (rt.Orders[0].DeliveryType == 1)
					{
						data[0].Details = new List<LmsVendorReturnOrderDetails>
												{
														new LmsVendorReturnOrderDetails{
																TransportCode =string.Format("{0}{1}", rt.Orders[0].ShipProvider , DateTime.Now.ToString("yyyyMMddHHmmss")),
																TransportProvider = rt.Orders[0].ShipProvider
														},
														new LmsVendorReturnOrderDetails{
																TransportCode = string.Format("{0}{1}", rt.Orders[0].ShipProvider, DateTime.Now.ToString("yyyyMMddHHmmss")),
																TransportProvider = rt.Orders[0].ShipProvider
														}
												};
					}
					res.Data = data;
					break;
				case "Inventory/Alert":
					var stockAlertReturnReq = req as StockAlertReturnReq;
          var errorProbability = new Random().Next(1, 5);

          if (errorProbability == 0) // 設定錯誤機率 
					{
						res.FailureCnt = 50; // 設定錯誤筆數
						if (stockAlertReturnReq.Data.Count>= res.FailureCnt)
						{
							res.IsSuccessed = false;
							res.MsgCode = "400-001";
							res.MsgContent = "庫存警示回報排程失敗";
							var response = new List<ApiResponse>();
							for (int i = 1; i <= res.FailureCnt; i++)
							{
								var randomIndex = new Random().Next(stockAlertReturnReq.Data.Count());
								var errorItem = stockAlertReturnReq.Data.Where((x, index) => index == randomIndex).FirstOrDefault();
								response.Add(new ApiResponse
								{
									MsgCode = "400-001",
									MsgContent = "資料錯誤",
									No = errorItem.ItemCode // 暫時用ITEM_CODE作為No
								});
							}
							res.Data = response;
						}
					}
					break;
        case "Items/Reply":
          var rd_UpdateItemInfo = new Random();
          var d_UpdateItemInfo = rd_UpdateItemInfo.Next(5);
          if (d_UpdateItemInfo == 1)
          {
            res.IsSuccessed = false;
            res.MsgCode = "99999";
            res.MsgContent = "LMS連線異常";
          }
          else
          {
            res.IsSuccessed = true;
            res.MsgCode = "21XXX";
            res.MsgContent = "轉入WMS建立庫存成功";
          }
          break;

      }
      return res;
		}

