        public ApiResult LmsApiGetAsync<T2, TErr>(string url)
        {
            var res = new ApiResult { IsSuccessed = true };
            var result = conn.GetAsync<LmsApiMultiResult<T2, TErr>>($"{LmsSetting.ApiUrl.Replace("ecoms/wmsapi/BPWMS/", "")}{url}", httpHeaderList).GetAwaiter().GetResult();
            if (conn.IsConnectSuccess == false)
            {
                res.IsSuccessed = false;
                res.MsgCode = "99999";
                res.MsgContent = "LMS連線異常。";
            }
            else
            {
                if (result != null)
                {
                    res.IsSuccessed = result.Code == "200";
                    res.MsgCode = result.Code;
                    res.MsgContent = result.Msg;
                    if (res.IsSuccessed || result.ErrorData == null)
                    {
                        res.Data = result.Data;
                    }
                    else
                    {
                        res.Data = result.ErrorData;
                    }
                }
            }
            res.OriAPIReturnMessage = conn.OriReturnValue;
						res.HttpCode = conn.HttpCode;
						res.HttpContent = conn.HttpContentValue;
						return res;
        }


