			var result = conn.GetFileAsync<T, LmsApiResult>(url, req, httpHeaderList).GetAwaiter().GetResult();
#else
			var result = conn.PostFileAsync<T, LmsApiResult>(url, req, httpHeaderList).GetAwaiter().GetResult();
#endif
			if (conn.IsConnectSuccess == false)
			{
				res.IsSuccessed = false;
				res.MsgCode = "99999";
				res.MsgContent = "LMS連線異常。";
			}
			else
			{
				if (result != null)
				{
					res.IsSuccessed = result.Code == "201" ? true : false;
					res.MsgCode = result.Code;
					res.MsgContent = result.Msg;
					res.Data = new { result.ContentType, FileBytes = result.Data };
				}
			}
      res.OriAPIReturnMessage = conn.OriReturnValue;
			res.HttpCode = conn.HttpCode;
			res.HttpContent = conn.HttpContentValue;
			return res;
		}
	}
}
